CREATE TABLE GPU(
   id          INTEGER  NOT NULL PRIMARY KEY 
  ,name        VARCHAR(130) NOT NULL
  ,price       NUMERIC(7,2)
  ,chipset     VARCHAR(28) NOT NULL
  ,memory      NUMERIC(5,3) NOT NULL
  ,core_clock  INTEGER 
  ,boost_clock INTEGER 
  ,color       VARCHAR(19)
  ,length      INTEGER 
);
